                                  $"\n{PrintAllPlayers})–í—ã–≤–µ—Å—Ç–∏ —Å–ø–∏—Å–æ–∫ –≤—Å–µ—Ö –∏–≥—Ä–æ–∫–æ–≤.\n{ExitProgram})–í—ã—Ö–æ–¥ –∏–∑ –ø—Ä–æ–≥—Ä–∞–º–º—ã.");
                string userInput = Console.ReadLine();

                switch (userInput)
                {
                    case AddPlayer:
                        database.AddPlayer();
                        break;

                    case BanPlayer:
                        database.BanPlayer();
                        break;

                    case UnbanPlayer:
                        database.UnbanPlayer();
                        break;

                    case DeletePlayer:
                        database.DeletePlayer();
                        break;

                    case PrintAllPlayers:
                        database.PrintAllPlayers();
                        break;

                    case ExitProgram:
                        isWorking = false;
                        break;

                    default:
                        Console.WriteLine("–ù–µ–≤–µ—Ä–Ω—ã–π –≤—ã–±–æ—Ä. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –µ—â–µ —Ä–∞–∑.");
                        break;
                }
            }
        }
    }

    class Database
    {
        private Dictionary<int, Player> _players = new Dictionary<int, Player>();
        private int _nextIdPlayer = 1;

        public void AddPlayer()
        {
            Console.WriteLine("–í–≤–µ–¥–∏—Ç–µ –Ω–∏–∫ –∏–≥—Ä–æ–∫–∞.");
            string nickname = Console.ReadLine();

            Console.WriteLine("–í–≤–µ–¥–∏—Ç–µ —É—Ä–æ–≤–µ–Ω—å");
            int level = ReadInt("–£—Ä–æ–≤–µ–Ω—å –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å —á–∏—Å–ª–æ–º. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –µ—â–µ —Ä–∞–∑:");

            Player player = new Player(_nextIdPlayer, nickname, level);

            _players.Add(_nextIdPlayer, player);
            _nextIdPlayer++;

            Console.WriteLine($"–ò–≥—Ä–æ–∫ {nickname} –¥–æ–±–∞–≤–ª–µ–Ω —Å ID {player.Id}");
        }

        public void BanPlayer()
        {
            int id = ReadInt("ID –∏–≥—Ä–æ–∫–∞ –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å —á–∏—Å–ª–æ–º. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –µ—â–µ —Ä–∞–∑:");
            if (TryGetPlayer(id, out Player player))
            {
                player.Ban();
                Console.WriteLine($"–ò–≥—Ä–æ–∫ {player.Nickname} (ID: {id}) –∑–∞–±–∞–Ω–µ–Ω.");
            }
        }

        public void UnbanPlayer()
        {
            int id = ReadInt("ID –∏–≥—Ä–æ–∫–∞ –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å —á–∏—Å–ª–æ–º. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –µ—â–µ —Ä–∞–∑:");
            if (TryGetPlayer(id, out Player player))
            {
                player.Unban();
                Console.WriteLine($"–ò–≥—Ä–æ–∫ {player.Nickname} (ID: {id}) —Ä–∞–∑–±–∞–Ω–µ–Ω.");
            }
        }

        public void DeletePlayer()
        {
            int id = ReadInt("ID –∏–≥—Ä–æ–∫–∞ –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å —á–∏—Å–ª–æ–º. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –µ—â–µ —Ä–∞–∑:");
            if (_players.Remove(id, out Player player))
            {
                Console.WriteLine($"–ò–≥—Ä–æ–∫ {player.Nickname} (ID: {id}) —É–¥–∞–ª–µ–Ω.");
            }
            else
            {
                Console.WriteLine($"–ò–≥—Ä–æ–∫ —Å ID {id} –Ω–µ –Ω–∞–π–¥–µ–Ω.");
            }
        }

        public void PrintAllPlayers()
        {
            if (_players.Count == 0)
            {
                Console.WriteLine("–í –±–∞–∑–µ –Ω–µ—Ç –∏–≥—Ä–æ–∫–æ–≤.");
            }
            else
            {
                Console.WriteLine("–°–ø–∏—Å–æ–∫ –∏–≥—Ä–æ–∫–æ–≤:");
                foreach (var player in _players.Values)
                {
                    player.ShowInfo();
                }
            }
        }

        private bool TryGetPlayer(int id, out Player player)
        {
            if (_players.TryGetValue(id, out player))
            {
                return true;
            }

            Console.WriteLine($"–ò–≥—Ä–æ–∫ —Å ID {id} –Ω–µ –Ω–∞–π–¥–µ–Ω.");
            return false;
        }

        private int ReadInt(string errorMessage)
        {
            int result;
            while (!int.TryParse(Console.ReadLine(), out result))
            {
                Console.WriteLine(errorMessage);
            }
            return result;
        }
    }

    class Player
    {
        public int Id { get; private set; }
        public string Nickname { get; private set; }
        public int Level { get; private set; }
        public bool IsBanned { get; private set; }

        public Player(int uniqueNumber, string nickname, int lvl, bool isBanned = false)
        {
            Id = uniqueNumber;
            Nickname = nickname;
            Level = lvl;
            IsBanned = isBanned;
        }

        public void Ban()
        {
            IsBanned = true;
        }

        public void Unban()
        {
            IsBanned = false;
        }

        public void ShowInfo()
        {
            string status = IsBanned ? "–ó–∞–±–∞–Ω–µ–Ω" : "–ê–∫—Ç–∏–≤–µ–Ω";
            Console.WriteLine($"ID: {Id} | –ù–∏–∫: {Nickname} | –£—Ä–æ–≤–µ–Ω—å: {Level} | –°—Ç–∞—Ç—É—Å: {status}");
        }
    }
}

